function part1(input) {
    const letters = input.split("");
    let prevEntry = [" ", 0];
    let dirty = false;

    letters.forEach((letter, i) => {
        const [prevLetter, prevIndex] = prevEntry;

        if (
            prevLetter != null &&
            letter.toLowerCase() == prevLetter.toLowerCase() &&
            letter != prevLetter
        ) {
            delete letters[i];
            delete letters[prevIndex];
            prevEntry = [letters[prevIndex - 1], prevIndex - 1];
            dirty = true;
        } else {
            prevEntry = [letter, i];
        }
    });

    if (dirty) {
        return part1(letters.join(""));
    }

    return letters.join("").length;
}

function part2(input) {
    const alphabet = "abcdefghijklmnopqrstuvwxyz".split("");

    return alphabet.reduce((prev, letter) => {
        const newInput = input.replace(new RegExp(letter, "gi"), "");

        const length = part1(newInput);

        // is shorter
        if (prev == null || length < prev) {
            return length;
        }

        return prev;
    }, null);
}

const input =
    "";

console.log(part1(input));
console.log(part2(input));
